#include <stdlib.h>

int minOperations(int* nums1, int nums1Size, int* nums2, int nums2Size) {
    if (nums1Size != nums2Size) return -1;

    int maxNums1 = nums1[0], maxNums2 = nums2[0];
    int indexMaxNums1 = 0, indexMaxNums2 = 0;
    int operations = 0;

    for (int i = 1; i < nums1Size; i++) {
        if (nums1[i] > maxNums1) {
            maxNums1 = nums1[i];
            indexMaxNums1 = i;
        }
        if (nums2[i] > maxNums2) {
            maxNums2 = nums2[i];
            indexMaxNums2 = i;
        }
    }

    if (nums1[nums1Size - 1] != maxNums1) {
        if (nums2[nums1Size - 1] == maxNums1) {
            int temp = nums1[nums1Size - 1];
            nums1[nums1Size - 1] = nums2[nums1Size - 1];
            nums2[nums1Size - 1] = temp;
            operations++;
        } else if (nums2[indexMaxNums1] > nums1[nums1Size - 1]) {
            int temp = nums1[indexMaxNums1];
            nums1[indexMaxNums1] = nums2[indexMaxNums1];
            nums2[indexMaxNums1] = temp;
            operations++;
        } else {
            return -1;
        }
    }

    if (nums2[nums2Size - 1] != maxNums2) {
        if (nums1[nums2Size - 1] == maxNums2) {
            int temp = nums2[nums2Size - 1];
            nums2[nums2Size - 1] = nums1[nums2Size - 1];
            nums1[nums2Size - 1] = temp;
            operations++;
        } else if (nums1[indexMaxNums2] > nums2[nums2Size - 1]) {
            int temp = nums2[indexMaxNums2];
            nums2[indexMaxNums2] = nums1[indexMaxNums2];
            nums1[indexMaxNums2] = temp;
            operations++;
        } else {
            return -1;
        }
    }

    return operations;
}
